scriptlet.script:
try {
	var sc = (statusCode != undefined)? parseInt(statusCode): -1;
	if(sc === 200) {
		var docs = JSON.parse(document);
		var action = docs['requestedAction']['name'];
		var serviceName = docs['requestedAction']['property'].filter(function(p) {return p['name'] === "SERVICE_NAME";})[0]['values'][0]['value'];
		switch(action) {
			case "ORDER":
			case "MODIFY_SUBSCRIPTION":
				scriptletResponse = action;
				break
			default:
				scriptletResponse = "OTHER";
		}
		scriptletContext.putGlobal("ACTION",action);
		scriptletContext.putGlobal("serviceName",serviceName);
	}
	else {
		throw new Error("Operation Get Request Details. HTTP Status Code: " + sc);
	}
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error + "\n" + document);
	scriptletResponse = "failure";	
}
